import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom"

class Header extends Component {

    render() {
        return (
            <Router>
                <header id={"header"}>
                    <Link to={"/"}>
                        <p id={"header_text"}>Easy Sender</p>
                    </Link>
                    <nav id={"nav_panel"}>
                        <Link to={"/addTemplate"}><p>Add</p></Link>
                        <Link to={"/modifyTemplate"}><p>Modify</p></Link>
                        <Link to={"/useTemplate"}><p>Use</p></Link>
                    </nav>
                </header>
            </Router>
        )
    }
}

export default Header
